DROP TABLE IF EXISTS `orders`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `orders` (
  `OrderID` int(11) NOT NULL AUTO_INCREMENT,
  `UserID` int(11) NOT NULL COMMENT '用户ID',
  `TicketID` int(11) NOT NULL COMMENT '票务ID',
  `OrderNo` varchar(50) NOT NULL COMMENT '订单号',
  `PassengerName` varchar(50) NOT NULL COMMENT '乘客姓名',
  `PassengerIDCard` varchar(18) DEFAULT NULL COMMENT '乘客身份证号',
  `ContactPhone` varchar(20) DEFAULT NULL COMMENT '联系电话',
  `TicketCount` int(11) NOT NULL DEFAULT '1' COMMENT '购票数量',
  `TotalPrice` decimal(10,2) NOT NULL COMMENT '总价',
  `OrderStatus` varchar(20) DEFAULT 'Pending' COMMENT '订单状态：Pending-待支付, Paid-已支付, Cancelled-已取消, Completed-已完成',
  `OrderTime` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '下单时间',
  PRIMARY KEY (`OrderID`),
  UNIQUE KEY `OrderNo` (`OrderNo`),
  KEY `UserID` (`UserID`),
  KEY `orders_ibfk_2` (`TicketID`),
  CONSTRAINT `orders_ibfk_1` FOREIGN KEY (`UserID`) REFERENCES `users` (`UserID`) ON DELETE CASCADE,
  CONSTRAINT `orders_ibfk_2` FOREIGN KEY (`TicketID`) REFERENCES `flight_info` (`flight_id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
